[Form]
public class RetailDevicesPart extends FormRun implements SysIFilterConsumerForm, SysIFilterEventHandler
{
}

/// <summary>
/// Register the data source to which the filter should be applied.
/// </summary>
public void registerDatasourceOnQueryingEvent()
{
    RetailDevice_DS.OnQueryExecuting += eventhandler(this.parmFilterFormQueryEventHandler().applyFilter);
}

/// <summary>
/// Event handler to react on a filter change.
/// </summary>
public void onFilterChanged()
{
    RetailDevice_DS.executeQuery();
}

/// <summary>
/// Enables downloading a self-service package.
/// </summary>
public void clicked()
{
    super();

    str packageDownloadUrl = RetailSelfServicePackageManager::GeneratePackageDownloadLink(RetailDevice.RecId, PackageType::ModernPosWithOffline, true);

    // Opens new tab and navigate to specified url
    RetailSelfServicePackageManager::OpenLinkInNewBrowserTab(packageDownloadUrl, "@RETAIL:SelfServicePkgRetrievalError");
}
